('email_club_auto_renew-completed', 'transaction', 'Auto-renew Transaction Completed (to club)', 'Auto-renew transactions have processed', 'The following members of [membership_name] were automatically renewed on [auto_renewal_date]:\n\n[auto_renewal_member_success]\n\nThe following members were not renewed because their cards were declined:\n\n[auto_renewal_member_failure]\n\nPlease note, all members on the declined list were removed from auto-renewal.', 1, 'ojr'),
('email_club_auto_renew-disabled', 'transaction', 'Auto-renew Disabled Globally (to club)', 'Auto-renew disabled by club or association', 'Auto-renew has been cancelled for all [membership_name] members. All  members who were scheduled to auto-renew through this club will no longer be auto-renewed.', 1, 'ojr'),
('email_club_auto_renew-member-disabled', 'transaction', 'Auto-renew Disabled (to club)', 'Auto-renew cancelled by GHIN #[member_num]', '[first_name] [last_name], GHIN number [member_num], canceled auto-renewal for his/her membership. His/her membership will expire on [inactivate_date] unless he/she renews it through the [sitename]''s website.', 1, 'ojr'),
('email_club_batch_renew', 'transaction', 'Batch Renewal (to club)', 'Batch renewal payment receipt for [membership_name]', '', 1, 'ojr'),
('email_club_join-approved', 'transaction', 'Join - Approved (to club)', 'Application approved for [membership_name]', 'You successfully approved [first_name] [last_name] for membership in [membership_name]. This golfer was added to your club in GHIN and was issued the GHIN number [member_num]. The golfer was notified that the application was approved.', 1, 'ojr'),
('email_club_join-pending', 'transaction', 'Join - Pending (to club)', 'Application pending for [membership_name]', 'The following golfer applied for membership in [membership_name].\n\n[first_name] [last_name]\n[address_1]\n[city], [state] [zip]\n[email]\n\n<a href="[approve_url]">Approve Golfer</a>\n\n<a href="[reject_url]">Reject Golfer</a>', 1, 'ojr'),
('email_club_join-rejected', 'transaction', 'Join - Rejected (to club)', 'Application declined for [membership_name]', 'You successfully declined [first_name] [last_name] for membership in [membership_name]. The golfer was issued a refund for $[amount] and was notified that the application was declined.', 1, 'ojr'),
('email_club_join-success', 'transaction', 'Join - Complete (to club)', '[first_name] [last_name] joined [membership_name]', 'The following golfer joined [membership_name] on [date_paid]. This golfer was added to your club in GHIN and was issued the GHIN number [member_num].\n\n[first_name] [last_name]\n[address_1]\n[city], [state] [zip]\n[email]\nTransaction amount: $[amount]', 1, 'ojr'),
('email_club_refund', 'transaction', 'Refund - Complete (to club)', 'A refund has been processed for GHIN #[member_num]', '[sitename] has processed a refund for $[amount] through Golf Nations for GHIN# [member_num]. ', 1, 'ojr'),
('email_club_renew-success', 'transaction', 'Renew - Complete (to club)', 'GHIN #[member_num] renewed membership in [membership_name]', 'The following golfer renewed his/her [membership_name] membership on [date_paid]. \n\nGHIN number: [member_num] \n[first_name] [last_name]\n[address_1]\n[city], [state] [zip]\n[email]\nTransaction amount: $[amount]', 1, 'ojr'),
('email_golfer_join-approved', 'transaction', 'Join - Approved (to golfer)', 'Your [membership_name] membership was approved', 'Your application to [membership_name] was approved by the club. Your GHIN number, which you will use to post scores, is [member_num]. \n\nShould you have questions, please contact [contact_name] at [contact_email].', 1, 'ojr'),
('email_golfer_join-pending', 'transaction', 'Join - Pending (to golfer)', 'Thank you for applying for [membership_name]', '[first_name] [last_name],\n\nThank you for applying for membership in [membership_name]. Your receipt is below.\n\nYour membership is currently pending. If approved by the club, you will receive a confirmation email which will include your GHIN number, the number you will use when posting scores. If your application is declined by the club, you will receive a full refund of the fees listed above.\n\nShould you have questions, please contact [contact_name] at [contact_email].\n\n[cart]', 1, 'ojr'),
('email_golfer_join-rejected', 'transaction', 'Join - Rejected (to golfer)', 'Your [membership_name] membership was declined', 'Your application to [membership_name] was declined by the club. We have refunded $[amount] to your credit card. \n\nShould you have questions, please contact [contact_name] at [contact_email].', 1, 'ojr'),
('email_golfer_join-success', 'transaction', 'Join - Complete (to golfer)', 'Thank you for joining [membership_name]', '[first_name] [last_name],\n\nThank you for joining [membership_name] and [sitename]. Your receipt is below. We have assigned you the following GHIN number, which you will use to post scores: [member_num]. Should you have questions, please contact [contact_name] at [contact_email].\n\n[cart]', 1, 'ojr'),
('email_golfer_refund', 'transaction', 'Refund - Complete (to golfer)', 'A refund has been processed for GHIN #[member_num]', '[sitename] has processed a refund for $[amount] through Golf Nations for GHIN# [member_num].', 1, 'ojr'),
('email_golfer_renew-success', 'transaction', 'Renew - Complete (to golfer)', 'Renewal receipt for GHIN #[member_num]', '[first_name] [last_name],\n\nThank you for renewing your [membership_name] and [sitename] membership. Your receipt is below. Should you have any questions, please contact [contact_name] at [contact_email].\n\n[cart]', 1, 'ojr'),
('email_member_auto_renew-completed', 'transaction', 'Auto-renew Transaction Completed (to golfer)', 'Auto-renew transaction completed for GHIN #[member_num]', 'Auto-renewal of your [sitename] and [membership_name] membership was processed on [date_paid]. Payment details below.\n\n[amount]', 1, 'ojr'),
('email_member_auto_renew-disabled', 'transaction', 'Auto-renew Disabled (to golfer)', 'Auto-renew cancelled for GHIN #[member_num]', 'Auto-renewal for your [sitename] and [membership_name] has been canceled. Your membership will expire [inactivate_date]. To ensure continuation of your membership, you must renew it through the [sitename] website.', 1, 'ojr'),
('email_member_auto_renew-payment_declined', 'transaction', 'Auto-renew Payment Declined (to golfer)', 'Your auto-renewal payment was declined for GHIN #[member_num]', 'The credit card used for auto-renewal of your [sitename] and [membership_name] memberships was declined. Your membership will expire [inactivate_date]. To ensure continuation of your membership, you must renew it through the [sitename] website.\n\nPlease note, we have taken you off auto-renewal. If you would like your membership to be auto-renewed in the future you must recheck the auto-renew box when renewing your membership.', 1, 'ojr'),
('email_member_auto_renew-pre1', 'transaction', 'Auto-renew 1st Renewal Notice (to golfer)', '1st reminder: GHIN #[member_num] will be auto-renewed on [auto_renewal_date]', 'Auto-renewal of your [sitename] and [membership_name] membership will be processed on [auto_renewal_date] for the amount listed below.\n\n[cart]\n\nTo cancel auto-renewal for this membership, <a href="[auto_renewal_opt_out_url]">click here</a>. If you cancel auto-renewal, your membership will expire [inactivate_date].\n', 1, 'ojr'),
('email_member_auto_renew-pre2', 'transaction', 'Auto-renew 2nd Renewal Notice (to golfer)', '2nd reminder: GHIN #[member_num] will be auto-renewed on [auto_renewal_date]', 'Auto-renewal of your [sitename] and [membership_name] membership will be processed on [auto_renewal_date] for the amount listed below.\n\n[cart]\n\nTo cancel auto-renewal for this membership, <a href="[auto_renewal_opt_out_url]">click here</a>. If you cancel auto-renewal, your membership will expire [inactivate_date].', 1, 'ojr');
